import { useTranslation } from "react-i18next";


function FooterPage() {
    const {t} = useTranslation()

    return ( 
        <div className="bg-white  py-2 bottom-0 right-0 w-full h-1/12 fixed grid grid-cols-2 gap-4 mt-4">
            <div className="flex justify-center items-center">
                <p>
                    {t('Footer.About')}  
                </p>
            </div>
            <div>
                <p>
                    {t('Footer.Contact')}  
                </p>
            </div>
        </div>
     );
}

export default FooterPage;
